import "./App.css";
import { BrowserRouter, Routes, Route } from "react-router-dom";

const App = () => {
  
  return (
    <BrowserRouter>
     <Routes>
      <Route path="/" element={<h1>Home Component</h1>}/>
      <Route path="/shop" element={<h1>Home Component</h1>}/>
     </Routes>
    </BrowserRouter>
  );
};

export default App;
